    /**
     *  id
     * @param appointmentNumber
     * @param cardNumber
     * @param sign
     * @return
     */
    @RequestMapping
    public FrontAjaxView sendDriverCard(String appointmentNumber, String cardNumber) {

        logger.info(" " + appointmentNumber);
        logger.info(" " + cardNumber);
        logger.info(" ================");
        cardNumber = RandomStringUtils.random(16, true, false).toUpperCase();
        ApprovalResults results = approvalResultsService.getResultByAppointmentNumber(appointmentNumber);
        AssertUtil.assertNotNull(results, "");
        AssertUtil.assertTrue(results.getState() == ApprovalResultState.APPLY_FOR_CARDNUMBER.getKey(), "");
        results.setCardNumber(cardNumber);
        results.setState(ApprovalResultState.TAKE_CARD.getKey());
        approvalResultsService.update(results);
        // 
        long formInstanceId = results.getFormInstanceId();
        TaskingBorder taskingBorder = taskingBorderService.getByFormInstanceId(formInstanceId);
        taskingBorder.setStatus(StatusType.NOTDO.getKey());
        taskingBorderService.update(taskingBorder);
        // 
        TaskingCiq taskingCiq = taskingCiqService.getByFormInstanceId(formInstanceId);
        taskingCiq.setStatus(StatusType.NOTDO.getKey());
        taskingCiqService.update(taskingCiq);
        // 
        TaskingCustoms taskingCustoms = taskingCustomsService.getByFormInstanceId(formInstanceId);
        taskingCustoms.setStatus(StatusType.NOTDO.getKey());
        taskingCustomsService.update(taskingCustoms);
        FrontAjaxView view = new FrontAjaxView();
        view.setMessage("id.");
        return view;
    }

